import React from "react";
const DoubleCardSection = ({ title, text, cards }) => {
  return (
    <div className="container pt-5 pb-5">
      {title && (
        <div className="row">
          <h2 className="text-center">{title}</h2>
        </div>
      )}
      {text && (
        <div className="row">
          <p className="text-center">{text}</p>
        </div>
      )}
      <div className="row cardsrow align-items-center">
        {cards?.length > 0 &&
          Object.entries(cards).map(([key, card]) => (
            <div key={key} className="singleCard col">
              {console.log(card)}
              {card?.title && <h3 className="cardsTitle">{card.title}</h3>}
              {card?.text && <p className="cardText">{card.text}</p>}
            </div>
          ))}
      </div>
    </div>
  );
};
export default DoubleCardSection;
